import React from "react";
import auditor from "../images/auditor.png";
import { institutions } from "../data";

function Institutions() {
  return (
    <div
      className="institutions-head"
      style={{ backgroundImage: `url(${auditor})` }}
    >
      {institutions.map((institution) => {
        const { id, name, tenantNames, imageUrl } = institution;
        return (
          <article key={id} className="institutions-institution">
            <img src={imageUrl} className="hospital-logo"></img>
            <header>
              <Link to={`/institution/${id}`}></Link>
            </header>
          </article>
        );
      })}
    </div>
  );
}

export default Institutions;
